import React from "react";
import Header from "../layout/Header";
import ProductForm from '../layout/ProductForm';
import Footer from "../layout/Footer";

function CreateProduct() {
    return (
        <div>
            <Header />
            <ProductForm />
            <Footer />
        </div>
    )
}

export default CreateProduct;
